import React from "react";
import { Link } from "react-router-dom";
import Userdata from "./Userdata";
function Users() {
  return (
    <div>
      <h1>Users</h1>
      {Userdata.map((eachUser) => {
        return (
          <Link>
            <article></article>
          </Link>
        );
      })}
    </div>
  );
}
export default Users;
